import React from 'react';

export class Resume extends React.Component {
    render() {
        return (
            <div>
            <h2 id="contactMe">Resume</h2>
            <ul>
                <li>
                    <a href="https://www.linkedin.com/in/drake-gooding-13a2591bb/">LinkedIn</a>

                </li>
                <li>
                    <a href="https://github.com/Drake-G">GitHub</a>
                </li>
                <li>Phone: 555-555-5555</li>
                <li>Email: dgooding1008@gmail.com</li>
            </ul>
            </div>  
        )
    }
}
